import React from 'react';
import AdditionForm from './AdditionForm';
const EmployeeAdd = () => {
  return (
    <>
      <h6 className="mt-6 mb-2 font-bold">
        Employee Details
      </h6>
      <hr className="mb-6 border-b-1 border-blueGray-200" />
      <AdditionForm />
    </>
  );
};

export default EmployeeAdd;
